How to make a submitted form undergo approval before appearing on the index page<p>Hi i'm building a app for people to be able to post jobs on a job board. But currently if a job is posted it goes straight to the homepage/index page and i don't want that. I want to be able to review the job posting before it goes live on the job board/homepage/index page. Any tutorial on this?</p>

<p>I.m currently using previous tutorial on Node to build this project.</p>



<pre class="lang-js prettyprint-override"><code>// Example code, but similar to actual code

//models config
let jobSchema = new mongoose.Schema({
    title: String,
    category: String,
    description: String,
    type: String,
    url: String,
    email: String,
    apply: String,
    location: String,
    company: String,
    path: String,
    created: {type: Date, default: Date.now}
})

let Job = mongoose.model('job', jobSchema);
// {type: String, default: "placeholdeimage.jpg"}

//routes config

var storage = multer.diskStorage({
    destination: function (req, file, cb) {
        cb(null, './public/uploads/');
    },

    filename: function (req, file, cb) {
        var originalname = file.originalname;
        var extension = originalname.split(".");
        filename = Date.now() + '.' + extension[extension.length-1];
        cb(null, filename);
    }
});


app.get('/', (req, res) =&gt;{
    res.redirect('/jobs')
})

app.get('/jobs',  (req, res) =&gt;{
    Job.find({}).sort({ date: -1}).find(function(err, jobs){
        if(err){
            console.log('error')
        }

        return res.render('index', {jobs: jobs})

    })

})

//add form route
app.get('/jobs/add', (req, res) =&gt; {
    res.render('add')
})

app.post('/jobs', multer({storage: storage, dest: 
'./public/uploads/'}).single('file'), (req, res) =&gt; {

    req.body.description = req.sanitize(req.body.description);

    Job.create( (err, addJob) =&gt;{

        if(req.file){
            let fullPath = "uploads/"+req.file.filename;
            let document = {
                title: req.body.title,
                category: req.body.category,
                description: req.body.description,
                type: req.body.type,
                url: req.body.url,
                email: req.body.email,
                apply: req.body.apply,
                location: req.body.location,
                company: req.body.company,
                path: fullPath
            };

            let job = new Job(document); 
                job.save()
        }else{
            console.log('file not uploaded')
            logo = 'noimage.jpg'
        }

        //redirect to index page
        return res.redirect('/jobs')
    })
})

app.get('/jobs/:id', (req, res) =&gt; {
    Job.findById(req.params.id, (err, jobDetails) =&gt; {
        if(err){
            res.redirect('/jobs')
        }else{
            res.render('details', {job: jobDetails});
        }
    })
})


app.listen(port, process.env.PORT, process.env.IP, ()=&gt; console.log(`Server 
is running on ${port}`))
</code></pre>

