How to return an object outside of mongoose .save().then()?<p>I have a GraphQL mutation that attempts to save an object to a MongoDB collection using Mongoose:</p>

<pre><code>Mutation: {
    addPost: (parent, args) =&gt; {
      let output = {};
      const newpost = new dbPost({
        _id: new mongoose.Types.ObjectId(),
        title: args.title,
        content: args.content,
        author: {
          id: args.authorid,
          first_name: args.authorfirstname,
          last_name: args.authorlastname,
        }
      });
      newpost.save().then((result) =&gt; {
        output = result;
      });
      return output // returns null, need result!
    },
  }
</code></pre>

<p>The script works just fine as in it successfully saves the object (passed to it through <em>args</em>) to the collection. However, I'm unable to return the object returned from inside <em>.then()</em> for further processing. In GraphiQL, the response is a null object. Is there any way, I could return the value of <strong>result</strong> outside of <strong>.then()</strong>?</p>

