How to send array from html to node.js and then to mongodb?<p>Need to send values of <em>long</em> and <em>lat</em> as one array in input, then save it in the database. Found a lot of examples that explain how to handle arrays, but most of them are in PHP.
Here's the code:</p>

<p><strong>HTML</strong></p>

<pre><code>&lt;html&gt;
&lt;head&gt;
    &lt;script&gt;
        function geoFindMe() {
            var coordinates = document.getElementById("coordinates");
            if (!navigator.geolocation) {
                alert("Geolocation is not supported by your browser");
                return;
            }
            function success(position) {
                var latitude  = position.coords.latitude;
                var longitude = position.coords.longitude;
                var coordinates = [longitude, latitude];
                document.getElementById("coordinates").value = coordinates;
            }
            function error() { alert("Unable to retrieve your location"); }
            navigator.geolocation.getCurrentPosition(success, error);
        }
    &lt;/script&gt;
&lt;/head&gt;
&lt;body&gt;   
    &lt;label for="pos"&gt;Allow location service&lt;/label&gt;
    &lt;input name="pos" id="coordinates" type="checkbox" onclick="geoFindMe()" value="coordinates[]"&gt;
&lt;/body&gt;
&lt;/html&gt;
</code></pre>

<p><strong>app.js</strong></p>

<pre><code>app.post("/", (req, res) =&gt; {
    const newUser = new data({
        geometry: {
            type:'Point',
            coordinates: req.body.coordinates
        }
    });
});
</code></pre>

<p><strong>data.js</strong></p>

<pre><code>const FindMyLocation = new Schema({
    geometry: {
        type: {
            type: String,
            default: 'Point'
        },
        coordinates: {
            type:[Number],
            index: '2dsphere'
        }
    }
});
</code></pre>

<p>Thanks for your attention.</p>

