<p>On a related note, I should probably just use the native MongoDB driver at this point, but it's working, so I'll just put it on my to do list for now.</p>; Answer: @SaumyaSuhagiya I haven't used clang for this (I am old, it is new).  So I don't know the specific API.  But what you should probably do when looking at this type of problem is draw up some scenarios you expect it to be able to detect *(for whatever you are detecting)* and then some scenarios that you think are too hard for it to detect.  Then explain to yourself concretely what it is that differentiates the easy cases from the too hard ones.  If you can very clearly know that, you have a chance of making a tool that can know it too.  Which is how these things work.

