<p>The format wouldn't bother me if the date would be the same but as you notice the value in the database is one day earlier then the value which I want to be.</p>

<p>So instead of <code>2018-09-20</code> is <code>2018-08-19</code>. My guess is that default UTC time is not the same or something like that but how can I set the correct UTC time?</p>

