Node.js and Express res.render() not doing anything?<p>I have looked at all the related posts and and spent a long time googling this, but have yet to find a solution. I am trying to render an ejs template, however, nothing seems to be happening. My code:</p>

<p>Front end script:</p>

<pre><code> $('#search').click(function(){
         var query =$('#search-query').val();//get value from searchbar
         var url = '/search/' + query;
         $.ajax({
         url: url,
    type:'GET',
    success: function(data){
      console.log('success');
    },
    error: function(){
      console.log('error');


  })
}
</code></pre>

<p>Backend:</p>

<pre><code>app.get("/search/:query", function(req, res){
  var query = req.params.query;
  Note.find({course: query}, function(err, foundNotes){//search database
    if(err){
      console.log(err);
    } else {
      console.log(foundNotes);//this displays the expected results from searching the database
      res.render('search.ejs', {notes: foundNotes});//appears to do nothing
      console.log('upload');//this also gets logged
    }

  })
});
</code></pre>

<p>Basically when a button is clicked I want it to make a GET request to the '/search/:query' path with the value in the input as the search query. I am then searching a database and then rendering an ejs template that displays the search results. </p>

<p>The troubling line is the res.render('search.ejs, {notes: foundNotes}). It doesn't seems to do anything. If I enter the path manually it works, but it does not seem to work from the button click. I think I may be missing a key concept here.</p>

<p>Any help would be greatly appreciated!</p>

